function Contact () {
    return(
        <>
            <div class="contact">
                <h1 class="contents">Contact Me</h1>
                <h2 class="contact"><a class="projects" href="https://www.linkedin.com/in/manar-elbeshbishy">LinkedIn</a></h2>
                <h2 class="contact"><a class="projects" href="https://github.com/m-el-code">Github</a></h2>
                <h2 class="contact"><a class="projects" href="mailto:manar.04e@gmail.com">Email</a></h2>
                <h2 class="contact"><a class="projects" href="https://drive.google.com/file/d/1Bp__EX0BnmyJjAs3TAHg4_CtHY_A5qJ9/view?usp=sharing">Resume</a></h2>

            </div>
        </>
    );
}

export default Contact;
